import React from "react";
import { Link } from "react-router-dom";
import "./navigation.css";

const Navigation = (props) => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">DPMO</Link>
        </li>
        <li>
          <Link to="/login">Login</Link>
        </li>
        <li>
          <Link to="/register">Register</Link>
        </li>
        <li>
          <ul>
            <Link to="/NewsForDate">deportes</Link>
            <Link to="/NewsForDate">politica</Link>
            <Link to="/NewsForDate">ciencias</Link>
          </ul>
        </li>
        <li>
          <Link to="/NewsCategory">Categorias</Link>
        </li>
      </ul>
    </nav>
  );
};

export { Navigation };
